import logo from './logo.svg';
import './App.css';
import CharactersList from './pages/CharactersList';
import { Route, BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <div>
      <Router>
       <Route path="/" component={CharactersList}/>
      </Router>
    </div>
  );
}

export default App;
